function UpdateNeuronsCheckList(_item) {
	if (HTML_CELLS_LIST[_item] == 1) {HTML_CELLS_LIST[_item] = 0} else  {HTML_CELLS_LIST[_item] = 1}
}
function MakeHexSymbol(_dec) {
	if (_dec == 10) {return "a"}
	if (_dec == 11) {return "b"}
	if (_dec == 12) {return "c"}
	if (_dec == 13) {return "d"}
	if (_dec == 14) {return "e"}
	if (_dec == 15) {return "f"}
	return _dec
}
function MakeHex(_dec) {
	FirstVal = String(MakeHexSymbol(Math.floor(_dec*16)))
	SecondVal = String(MakeHexSymbol(Math.floor(_dec*256-Math.floor(_dec*16)*16)))
	return FirstVal+SecondVal
}
function MakeFFRGB(_rgb) {
	///console.log(_rgb)
	if (_rgb) {return "#"+MakeHex(_rgb.r)+MakeHex(_rgb.g)+MakeHex(_rgb.b) ; }
	else {return "#000000"}
}

function RescaleLayers(ret) {
	for (each in ret) {
		for (eachcluster in ret[each]) {
			for (eachline in ret[each][eachcluster]) { 
if (!ret[each][eachcluster][eachline].xyz) { 
				ret[each][eachcluster][eachline].xyz = [] } 
				for (eachxyz in ret[each][eachcluster][eachline].xz) {

function FindDistFromPointToCut(_point,_xyz1,_xyz2,_numind) {
///console.log("kkkkkk",_point,_xyz1,_xyz2)

/*
(_xyz1[0]-lxa)/lxb = (_xyz1[1]-lya)/lyb = (_xyz1[2]-lza)/lzb
(_xyz2[0]-lxa)/lxb = (_xyz2[1]-lya)/lyb = (_xyz2[2]-lza)/lzb

*/
//param line equation
	lxb = _xyz2[0] - _xyz1[0]
	lyb = _xyz2[1] - _xyz1[1]
	lzb = _xyz2[2] - _xyz1[2]
	lxa = _xyz1[0]
	lya = _xyz1[1]
	lza = _xyz1[2]
	td = (lxb*_point[0]+lyb*_point[1]+lzb*_point[2]-lxb*lxa-lyb*lya-lzb*lza)/(lxb*lxb+lyb*lyb+lzb*lzb)
	_projection_point = [lxb*td+lxa,lyb*td+lya,lzb*td+lza]

	_isprojectionpointinsidecut = 1
	_xmin = _xyz1[0]
	_xmax = _xyz2[0]
	if (_xyz1[0] > _xyz2[0]) {
		_xmin = _xyz2[0]
		_xmax = _xyz1[0]
	}
	_ymin = _xyz1[1]
	_ymax = _xyz2[1]
	if (_xyz1[1] > _xyz2[1]) {
		_ymin = _xyz2[1]
		_ymax = _xyz1[1]
	}
	_zmin = _xyz1[2]
	_zmax = _xyz2[2]
	if (_xyz1[2] > _xyz2[2]) {
		_zmin = _xyz2[2]
		_zmax = _xyz1[2]
	}
	if ((_projection_point[0] < _xmin) || (_projection_point[0] > _xmax) || (_projection_point[1] < _ymin) || (_projection_point[1] > _ymax) || (_projection_point[2] < _zmin) || (_projection_point[2] > _zmax)) {_isprojectionpointinsidecut = 0}

	distpoint1 = (_xyz1[0]-_point[0])*(_xyz1[0]-_point[0])+(_xyz1[1]-_point[1])*(_xyz1[1]-_point[1])+(_xyz1[2]-_point[2])*(_xyz1[2]-_point[2])
	distpoint2 = (_xyz2[0]-_point[0])*(_xyz2[0]-_point[0])+(_xyz2[1]-_point[1])*(_xyz2[1]-_point[1])+(_xyz2[2]-_point[2])*(_xyz2[2]-_point[2])
	distpointproj = (_projection_point[0]-_point[0])*(_projection_point[0]-_point[0])+(_projection_point[1]-_point[1])*(_projection_point[1]-_point[1])+(_projection_point[2]-_point[2])*(_projection_point[2]-_point[2])
	_mindist = distpoint1 ; 
	_minind = _numind ; 
	_mincoord = _xyz1 ; 
	if (distpoint1 > distpoint2) {
		_mindist = distpoint2 ;
		_minind = _numind + 1 ; 
		_mincoord = _xyz2 ; 
	}
	if (_isprojectionpointinsidecut == 1) {
		if (distpointproj < _mindist) {
			_mindist = distpointproj ;
			_mincoord = _projection_point ; 
		}
	}

	return {dist:_mindist, closestpointxyz:_mincoord,numind:_minind}
}
function GetLineAnalysis(_line,_begxyz,_endxyz, _coverLegth) {
///console.log("lll",_line,_begxyz,_endxyz)
	_begdist = 999999 ; 
	_enddist = 999999 ; 
	_begind = 0 ; 
	_endind = 0 ; 
	///_begxyz = [0,0,0] ; 
	///_endxyz = [0,0,0] ; 
	for (i = 0; i < _line.xyz.length - 1; i++) {
		_currbegdist = FindDistFromPointToCut(_begxyz,_line.xyz[i],_line.xyz[i+1],i) ; 
		_currenddist = FindDistFromPointToCut(_endxyz,_line.xyz[i],_line.xyz[i+1],i) ; 
		if (_currbegdist.dist < _begdist) {
			_begdist = _currbegdist.dist
			_begind = _currbegdist.numind /// i + 1 ;
			_begxyz2 = _currbegdist.closestpointxyz ;
		}
		if (_currenddist.dist < _enddist) {
			_enddist = _currenddist.dist
			_endind = _currenddist.numind /// i + 1 ;
			_endxyz2 = _currenddist.closestpointxyz ;
		}
///console.log("NNN",i,_currbegdist,_currenddist)
	}
///console.log(_endxyz)	
if (_endxyz == 0) {
if ( _coverLegth > 0) {
_endind = _line.xyz.length-1
_enddist = 0 ; 
_endxyz2 = _line.xyz[_line.xyz.length - 1]
} else {
_endind = 0
_enddist = 0 ; 
_endxyz2 = _line.xyz[0]
} 
}
///console.log("TOO BIG DISTANCE BUG", _begdist+_enddist, _line,_begxyz,_endxyz, _coverLegth)
	return {begenddist:_begdist+_enddist,begpoint:{begxyz:_begxyz2,begind:_begind},endpoint:{endxyz:_endxyz2,endind:_endind}}
}
 

function getCutLength(_xyz1,_xyz2) {
	return Math.sqrt((_xyz2[0]-_xyz1[0])*(_xyz2[0]-_xyz1[0])+(_xyz2[1]-_xyz1[1])*(_xyz2[1]-_xyz1[1])+(_xyz2[2]-_xyz1[2])*(_xyz2[2]-_xyz1[2]))
}







function ExtendPoint(_PrevXYZ, _CurrSomaAxon, _len) {
	ret = [_CurrSomaAxon[0] + _len, _CurrSomaAxon[1] + _len, _CurrSomaAxon[2] + _len]
	_cutlen = Math.sqrt(((_CurrSomaAxon[0]-_PrevXYZ[0])*(_CurrSomaAxon[0]-_PrevXYZ[0]))+((_CurrSomaAxon[1]-_PrevXYZ[1])*(_CurrSomaAxon[1]-_PrevXYZ[1]))+((_CurrSomaAxon[2]-_PrevXYZ[2])*(_CurrSomaAxon[2]-_PrevXYZ[2])))
	_k = 1
	if (_cutlen != 0) {_k = _len/_cutlen}
	ret = [(_k*(_CurrSomaAxon[0] - _PrevXYZ[0]))+_CurrSomaAxon[0],(_k*(_CurrSomaAxon[1] - _PrevXYZ[1]))+_CurrSomaAxon[1],(_k*(_CurrSomaAxon[2] - _PrevXYZ[2]))+_CurrSomaAxon[2],]
///console.log("ggg3", _PrevXYZ, _CurrSomaAxon, _len)
	return ret
}
